import styled from 'styled-components';
function Question({
  question,
  wrongAnswer,
  wrongAnswerComment,
  correctAnswer,
  correctAnswerComment
}) {
  return (
    <div>
      {question}<br />
      {wrongAnswer}<br />
      {wrongAnswerComment}<br />
      {correctAnswer}<br />
      {correctAnswerComment}
    </div>
  );
}

export default Question;

const Wrapper = styled.div`
  margin: 24px 0;
`
